import React from "react";
import "./App.css";
import Mastercard from "./mastercard.png";
import Sbi from "./sbi.png";
function Card() {
  return (
    <section className="card-section">
      <div className="front-face">
        <header>
          <h2 style={{marginLeft:20}}>gold</h2>
            <img src={Sbi} id="sbi-logo" alt="sbi logo" width={70} />
        </header>

        <div className="details">
            <h2 className="name">Sharath Donepudi</h2>
            <img src={Mastercard} id="mastercard-logo" alt="mastercard logo" width={100}/>
        </div>
      </div>

      <div className="back-face"></div>
    </section>
  );
}

export default Card;
